    <div class="text--center">
      <iframe width="560" height="315" src="https://www.youtube.com/embed/EUY8WyQdR-o" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    <p>{`RedisInsight is a free product from Redis that provides an intuitive graphical user interface for managing Redis databases. RedisInsight allows you to browse Redis and monitor changes in data in real time.  You can edit data stored in existing keys, create and delete new ones, and run redis-cli commands.`}</p>
    <p>{`RedisInsight also supports some popular Redis modules, and we'll use it in this course to look at data managed by the RedisJSON and RediSearch modules.  The data type specific views in RedisInsight make visualizing even the most complex Redis data types easy.  We'll benefit from this when we look at Redis Streams later in the course.`}</p>
    <p>{`For this course, we'll be running Redis in a Docker container.  While you can complete the course using just the redis-cli interface provided with the container, we'd strongly recommend that you `}<a parentName="p" {...{
        "href": "https://redis.com/redis-enterprise/redis-insight/"
      }}>{`download and install RedisInsight`}</a>{` to benefit from its graphical interface and specialized views for Redis data types and modules.`}</p>
    <p>{`We'll cover how to connect RedisInsight to our Redis server in the "Up and Running with the Sample Application" module shortly.`}</p>
    <h2 {...{
      "id": "external-resources"
    }}>{`External Resources`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://redis.com/redis-enterprise/redis-insight/"
        }}>{`RedisInsight Home Page and downloads`}</a></li>
